using AutoMapper;
using Dividendos.API.Model.Response;
using Dividendos.API.Model.Response.Common;
using Dividendos.API.Model.Response.v1;
using Dividendos.Application.Base;
using Dividendos.Application.Interface;
using Dividendos.Entity.Entities;
using Dividendos.Entity.Model;
using Dividendos.Repository.Interface.UoW;
using Dividendos.Service.Interface;
using Microsoft.Extensions.Caching.Distributed;
using Microsoft.Extensions.Options;
using Newtonsoft.Json;
using System;
using System.Collections.Generic;

namespace Dividendos.Application
{
    public class PartnerApp : BaseApp, IPartnerApp
    {
        private readonly IPartnerService  _partnerService;
        private readonly IMapper _mapper;
        private readonly IUnitOfWork _uow;
        private readonly IGlobalAuthenticationService _globalAuthenticationService;

        public PartnerApp(IMapper mapper,
            IUnitOfWork uow,
            IPartnerService partnerService,
            IGlobalAuthenticationService globalAuthenticationService)
        {
            _partnerService = partnerService;
            _mapper = mapper;
            _uow = uow;
            _globalAuthenticationService = globalAuthenticationService;
        }
        
        public ResultResponseObject<PartnerOptionVM> GetSubscriptionByPartnerIsAvailable()
        {
            ResultResponseObject<PartnerOptionVM> result = null;

            using (_uow.Create())
            {
                ResultServiceObject<bool> resultService = _partnerService.GetSubscriptionByPartnerIsAvailable(_globalAuthenticationService.IdUser);

                result = new ResultResponseObject<PartnerOptionVM>();
                result.Success = true;
                if (resultService.Value)
                {
                    result.Value = new PartnerOptionVM();
                    result.Value.HTMLContentButton = "<!DOCTYPE html> <html lang='pt-BR'> <head>   <meta charset='UTF-8'>   <meta http-equiv='X-UA-Compatible' content='IE=edge'>   <meta name='viewport' content='width=device-width, initial-scale=1.0'>   <title>Partner</title> </head> <style type='text/css'>   html, body{     margin: 0;     padding: 0;   }    h1, h2, h3, h4, h5, p{     margin: 0;     text-align: center;   }   .container{     display: flex;     flex-direction: row;     justify-content: space-around;     align-items: center;     width: 100%;     height: 100px;     background-color: #6230B5;     border: 1px solid #6230B5;     font-family: Arial, Helvetica, sans-serif;     color: #fff;   }   .container .logo{     width: 70px;     height: 70px;     object-fit: contain;     margin: 8px;   }    .container .area-text{     display: flex;     flex: 1;     flex-direction: column;     align-items: flex-start;     margin: 8px;     padding: 8px 0;   }    .container .area-text p{     font-size: 13px;     margin-top: 6px;     text-align: left;   }    </style> <body>   <div class='container'>     <img src='data:image/png;base64,' class='logo' alt='Logo'>     <div class='area-text'>       <h4>GANHE UMA ASSINATURA!</h4>       <p>Quer ganhar 1 ano de assinatura do App Dividendos.me e muitos outros benefícios? <b>Clique e confira como!</b></p>     </div>   </div> </body> </html>";
                }
            }

            return result;
        }

        public ResultResponseObject<IEnumerable<PartnerVM>> GetAvailableV2()
        {
            ResultResponseObject<IEnumerable<PartnerVM>> result = null;

            using (_uow.Create())
            {
                ResultServiceObject<IEnumerable<Partner>> resultService = _partnerService.GetAllAvailable(_globalAuthenticationService.IdUser);

                result = _mapper.Map<ResultResponseObject<IEnumerable<PartnerVM>>>(resultService);
            }

            return result;
        }

        public ResultResponseObject<PartnerVM> GetAvailableV1()
        {
            ResultResponseObject<PartnerVM> result = null;

            using (_uow.Create())
            {
                ResultServiceObject<Partner> resultService = _partnerService.GetAvailable(_globalAuthenticationService.IdUser);

                result = _mapper.Map<ResultResponseObject<PartnerVM>>(resultService);
            }

            return result;
        }

        public ResultResponseObject<PartnerVM> GetDetail(Guid partnerGuid)
        {
            ResultResponseObject<PartnerVM> result = null;

            using (_uow.Create())
            {
                ResultServiceObject<Partner> resultService = _partnerService.GetDetail(partnerGuid);

                result = _mapper.Map<ResultResponseObject<PartnerVM>>(resultService);
            }

            return result;
        }
    }
}